// eslint-disable-next-line
import React from "react";
import "./Navbar.css";

function Navbar() {
  const open = () => {
    document.getElementById("mySidenav").style.width = "250px";
  };

  const close = () => {
    document.getElementById("mySidenav").style.width = "0";
  };

  return <></>;
}

export default Navbar;
